from helpers import xor 
from helpers import bits_to_characters
import itertools
import base64

###### Exercise 2 parameters
Q2_p=116333778062608290211704753718178975779457618216297671379796479796086905969884204961246538226322005759233
Q2_n=116333778062608290211704753718178975779457618216297671379796479796086905969884204961246538226322005759234
Q2_k=23938812140417460463387337092429468813585244147696655759576593425428525635174468035465036963985878991487
Q2_ct=b''


# convert the ciphertext to binary
bin_ct = ''.join([ "{:08b}".format(ord(x)) for x in base64.b64decode(Q2_ct).decode()]) 


# bruteforce center of symmetry
for idx in range(1, len(bin_ct)):
    counter_equal_bits = 0
    while(True):
        # if we are on the edges of the string, than break -> we cannot encounter more symmetric bits
        if idx - counter_equal_bits - 1 < 0 or idx + counter_equal_bits + 1 >= len(bin_ct):
            break
        # if a non symmetrically equal bit is found, then break
        if bin_ct[idx-counter_equal_bits -1] != bin_ct[idx+counter_equal_bits+1]:
            break
        counter_equal_bits += 1
    # if many bits are symmetrically equal around c_idx, with high probability it is the index of the point at infinity
    if (counter_equal_bits > 100):
        c_idx = idx


# assuming that c_idx is in the first half of the binary conversion of the ciphertext

# this for loop is needed to explore the neighborohod of the starting point of the plaintext
for j in range(-3, 4):
        
    # count the number of bits symmetrically equal around c_idx
    counter_equal_bits_from_center = 0
    while(True):
        if bin_ct[c_idx-counter_equal_bits_from_center -1] != bin_ct[c_idx+counter_equal_bits_from_center+1]:
            break
        counter_equal_bits_from_center += 1
    
    # the index of the end of the part of the string that is not equal to its symmetric with respect to c_idx
    left_diff_end_idx = c_idx - counter_equal_bits_from_center - 1
    
    # count the number of bits symmetrically equal (wrt c_idx) near the edges of the bitstring
    counter_equal_bits_from_extr = 0
    while(True):
        if bin_ct[counter_equal_bits_from_extr] != bin_ct[2 * c_idx - counter_equal_bits_from_extr]:
            break
        counter_equal_bits_from_extr += 1

    # the index of the beginning of the part of the string that is not equal to its symmetric with respect to c_idx
    left_diff_start_idx = counter_equal_bits_from_extr

    # the padding is always done using bytes so we deduce the index of the start and the end of the symmetric
    # pieces of bitstring that differs although they are symmetric
    left_diff_start_byte_idx = left_diff_start_idx - (left_diff_start_idx % 8)
    left_diff_end_byte_idx = left_diff_end_idx + (7 - (left_diff_end_idx % 8))
    # the lenght of the message is the difference between the last and the first bit indices + 1
    msg_len = left_diff_end_byte_idx - left_diff_start_byte_idx + 1

    # xor the two parts of the string that are symmetric but different 
    # note: on the left-hand side we increase the index, 
    # on the right hand side we decrease it in order to read it backwards
    bin_pt = ''
    for i in range(msg_len):
        bin_pt += xor(bin_ct[left_diff_start_byte_idx + j + i], bin_ct[2 * c_idx - left_diff_start_byte_idx - j - i])
    
    # try to convert the bitstring to characters assuming that the ct is on the left of c_idx
    try:
        print(bits_to_characters(bin_pt))
    except:
        continue
    
    # try to convert the bitstring to characters assuming that the ct is on the right of c_idx (so it is reverted)
    try:
        print(bits_to_characters(bin_pt[::-1]))
    except:
        continue

